import { useNavigate,NavLink } from 'react-router-dom';
import "./login.css"
import React, { useState } from 'react';
import logo from'./images/MyLogo.png';


const Login =() => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [verificationResult, setVerificationResult] = useState('');
  const navigate = useNavigate();
  const verifyCredentials = () => {
    const normalUsername = "borgimoatez@gmail.com";
    const normalPassword = "mimwc123";
    const superUsername = "9antra@hotmail.com";
    const superPassword = "admin123";

    if (username === normalUsername && password === normalPassword) {
      navigate('/');
    } else if (username === superUsername && password === superPassword) {
      navigate('/');
    } else {
      setVerificationResult("Invalid credentials.");
    }
  }
  function onSubmittoforgetpass()
  {

    navigate('/forgetpassword');
  }
  function onSubmittoregister()
  {

    navigate('/register');
  }
 

  return (
  
  
    <div className="container d-flex justify-content-center align-items-center min-vh-100">
      {/* Login */}
      <div className="row border rounded-5 p-3 bg-white shadow box-area">
        {/* Left Box */}
        <div className="col-md-6 rounded-4 d-flex justify-content-center align-items-center flex-column left-box" >
         
            <img src={logo} className="img-fluid" alt="Website Logo"/>
          
          <p className="text-white fs-2" style={{ fontFamily: 'cursive', fontWeight: 700 }}>  your professional life </p>
          <small className="text-white text-wrap text-center" style={{ width: '17rem', fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif" }}>Join our platform.</small>
        </div>

        {/* Right Box */}
        <div className="col-md-6 right-box">
          <div className="row align-items-center">
            <div className="header-text mb-4">
              <h2>Hello</h2>
              <p>We are happy to have you back.</p>
            </div>
            <div className="input-group mb-3">
              <input type="email" className="form-control form-control-lg bg-light fs-6" placeholder="Email address" id="email"  onChange={(e) => setUsername(e.target.value)}/>
            </div>
            <div className="input-group mb-3">
              <input type="password" className="form-control form-control-lg bg-light fs-6" placeholder="Password" id="password" onChange={(e) => setPassword(e.target.value)}/>
            </div>
            <div className="input-group mb-5 d-flex justify-content-between">
              <div className="form-check">
                <input className="form-check-input" type="checkbox" value="" id="flexCheckDefault" />
                <label className="form-check-label" htmlFor="flexCheckDefault">
                  Remember Me
                </label>
              </div>
              <div className="forgot">
                <a href="#" style={{ textDecoration: 'none' }} onClick={onSubmittoforgetpass} >Forgot Password?</a>
              </div>
            </div>
            <div className="input-group mb-3" id="login">
            <button  className="loginbtnn" onClick={verifyCredentials}>login</button>
            </div>
            <p className="social-text">Or Sign in with social platforms</p>
            <div className="social-media">
              <a href="#" className="social-icon">
                <i className="fab fa-facebook-f"></i>
              </a>
              <a href="#" className="social-icon">
                <i className="fab fa-twitter"></i>
              </a>
              <a href="#" className="social-icon">
                <i className="fab fa-google"></i>
              </a>
            </div>
            <div className="row">
              <small>Don't have an account? <a onClick={onSubmittoregister}>Sign Up</a></small>
            </div>
          </div>
        </div>
      </div>
    </div>


  );
}

export default Login;
